import {
    faLocationPin,

} from "@fortawesome/free-solid-svg-icons";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

function EachPost({title}){
    return (
        <EachPostLi>
            <div>
                <FontAwesomeIcon icon={faLocationPin} />
                <PostLink>{title}</PostLink>
            </div>

        </EachPostLi>
    );
}

export default EachPost;
